import React , {useState , useEffect} from "react";
import "./styles.css";
import { Route, Switch, NavLink, Link } from 'react-router-dom'
import Login from "./scenes/login";
import LupaPassword from "./scenes/lupa-password";
import NotFound from "./scenes/404";
import Register from "./scenes/register";
import Private from "./scenes/private";

export default function App() { 
  return (

      <Switch>
         <Route  path="/" component={Private} exact/>
          <Route path="/pengaturan" component={Private} />
          <Route path="/transaksi" component={Private} />
          <Route path="/produk" component={Private}  />
        <Route path="/register" component={Register} />
        <Route path="/login" component={Login} />
        <Route path="/lupa-password" component={LupaPassword} />
        <Route component={NotFound} />
      </Switch>
  );
}
